To read the temperature from a Dallas 18B20 temperature sensor using an ESP32, you can use the OneWire library. Here's a sample code that reads the temperature from multiple 18B20 sensors connected to an ESP32:

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

#define ONE_WIRE_BUS D0 // Change this to the appropriate pin if your 1-wire bus is not connected to D0

OneWire oneWire(ONE_WIRE_BUS);
DallasTemperature sensors(&oneWire);

const int numSensors = 4; // Change this to the number of 18B20 sensors you have connected
int sensorAddresses[4] = {0x18, 0x19, 0x1A, 0x1B}; // Change these addresses to match your sensors

void setup() {
  Serial.begin(115200);
  sensors.begin();
}

void loop() {
  sensors.requestTemperatures();
  for (int i = 0; i < numSensors; i++) {
    float tempC = sensors.getTempC(sensorAddresses[i]);
    String tempStr = String(tempC, 2);
    Serial.print("Sensor Address: ");
    Serial.println(sensorAddresses[i], HEX);
    Serial.print("Temperature: ");
    Serial.println(tempStr + " C");
  }
  delay(2000); // Wait for 2 seconds before reading again
}
```

In this code, replace `numSensors` and `sensorAddresses` with the correct values for your setup. The `numSensors` variable should be set to the number of 18B20 sensors you have connected, and the `sensorAddresses` array should contain the hexadecimal addresses of each sensor.

The code initializes the OneWire library and DallasTemperature library, then reads the temperature from each sensor in a loop. It prints the sensor address (in hexadecimal) and the temperature (in Celsius) to the serial monitor. The `delay(2000)` function call waits for 2 seconds before reading the sensors again.

Sure, here is an implementation of the Bubble Sort algorithm in C:

```c
#include <stdio.h>

void bubbleSort(int array[], int n) {
    for (int i = 0; i < n-1; i++) {     
        for (int j = 0; j < n-i-1; j++) { 
            if (array[j] > array[j+1]) {
                // Swap array[j] and array[j+1]
                int temp = array[j];
                array[j] = array[j+1];
                array[j+1] = temp;
            }
        }
    }
}

void printArray(int array[], int size) {
    for (int i = 0; i < size; i++)
        printf("%d ", array[i]);
    printf("\n");
}

int main() {
    int data[] = {-2, 45, 0, 11, -9};
    int n = sizeof(data) / sizeof(data[0]);
    bubbleSort(data, n);
    printf("Sorted Array in Ascending Order:\n");
    printArray(data, n);
    return 0;
}
```

This program sorts an integer array using the Bubble Sort algorithm. The `bubbleSort` function performs the sorting, while the `printArray` function prints out the elements of the array. In the `main` function, we define an array to be sorted and then call the `bubbleSort` function on it. After sorting, we print the sorted array. 

Bubble Sort works by repeatedly swapping the adjacent elements if they are in wrong order. It continues this process until no more swaps are needed, which indicates that the list is sorted.

