La fórmula de Bhaskara se utiliza para resolver ecuaciones cuadráticas y se puede representar en LaTeX de la siguiente manera:

```latex
\documentclass{article}
\usepackage{amsmath}

\begin{document}

La fórmula de Bhaskara es:
\begin{equation}
x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}
\end{equation}

\end{document}
```

