En Java, el operador "if" se utiliza para ejecutar bloques de código solo si una condición es verdadera. Aquí te dejo un ejemplo básico:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
}
```

En este ejemplo, la condición es `numero > 5`. Si `numero` es mayor que 5, entonces se imprimirá "El número es mayor que 5". 

Si quieres que se ejecute un código diferente si la condición no es verdadera, puedes usar el operador "else":

```java
int numero = 4;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
} else {
    System.out.println("El número no es mayor que 5");
}
```

En este caso, se imprimirá "El número no es mayor que 5", porque `numero` es menor o igual a 5.

Además, puedes usar "else if" para agregar más condiciones:

```java
int numero = 6;

if (numero < 5) {
    System.out.println("El número es menor que 5");
} else if (numero > 5) {
    System.out.println("El número es mayor que 5");
} else {
    System.out.println("El número es igual a 5");
}
```

En este ejemplo, se imprimirá "El número es mayor que 5", porque `numero` es mayor que 5.

