To solve this problem, we will first create a helper function `isPrime` to check if a given number is prime. Then, we will implement the main function `checkPrimeInArray` which iterates through the input array and uses the `isPrime` function to find and output the first prime number it encounters.

Here's the complete code:

```javascript
// Helper function to check if a number is prime
function isPrime(num) {
  if (num <= 1) return false;
  for (let i = 2; i * i <= num; i++) {
    if (num % i === 0) return false;
  }
  return true;
}

// Main function to check prime in an array
function checkPrimeInArray(numbers) {
  for (let i = 0; i < numbers.length; i++) {
    if (isPrime(numbers[i])) {
      console.log(numbers[i]);
      return; // Exit after finding the first prime number
    }
  }
}

// Example usage
const numbers = [4, 7, 10, 13, 16];
checkPrimeInArray(numbers);
```

This code snippet defines the `isPrime` function that checks if a number is prime by iterating up to the square root of the number. The `checkPrimeInArray` function then iterates over the input array, using `isPrime` to find the first prime number, and outputs it to the console.
